About the Authors
Laura Maffeo has worked as a stylist for Martha Stewart Weddings, Home, Seventeen, Family Circle Home Crafts, and Everyday with Rachel Ray. She is the author of Girls' Night in: Fabulous Ideas for Evenings with Friends (Ryland Peters &amp; Small, 2006).
